import React, { useEffect } from 'react';
import { useNavigate, useLocation, Navigate } from 'react-router-dom';
import { LoadingSpinner } from '../ui';

type ResultPageProps = {
  campaignId?: string;
  facilityId?: string;
  gradeId?: string;
  studentId?: string;
  cwpm?: number;
  correct?: number;
  incorrect?: number;
  missed?: number;
  extra?: number;
};

const ResultPage: React.FC = () => {
  const navigate = useNavigate();
  const location = useLocation();
  const state = location.state as ResultPageProps | null;

  // If we have a studentId, redirect to the legacy ResultsView
  useEffect(() => {
    if (state?.studentId) {
      navigate(`/admin/results/${state.studentId}`, { replace: true });
    }
  }, [state?.studentId, navigate]);

  // Show loading while redirecting, or redirect to dashboard if no studentId
  if (state?.studentId) {
    return (
      <div className="container-fluid py-4">
        <LoadingSpinner text="Loading results..." />
      </div>
    );
  }

  // If no studentId, redirect to dashboard
  return <Navigate to="/dashboard" replace />;

  return (
    <div className="container-fluid py-4">
      <PageHeader
        title="Assessment Results"
        subtitle="Test completed successfully"
      />

      <div className="row justify-content-center mb-4">
        <div className="col-md-8 col-lg-6">
          <Card className="text-center py-5">
            <div className="cwpm-score mb-3">{metrics.cwpm}</div>
            <div className="text-secondary h5 mb-4">Correct Words Per Minute (CWPM)</div>

            <div className="row g-3 mt-4">
              <div className="col-6">
                <Card className="p-3">
                  <div className="d-flex align-items-center justify-content-center gap-2 mb-2">
                    <div
                      className="legend-color"
                      style={{ background: COLORS.wordType.correctAlpha }}
                    ></div>
                    <h5 className="mb-0">Correct</h5>
                  </div>
                  <div className="h3 text-dark">{metrics.correct}</div>
                </Card>
              </div>
              <div className="col-6">
                <Card className="p-3">
                  <div className="d-flex align-items-center justify-content-center gap-2 mb-2">
                    <div
                      className="legend-color"
                      style={{ background: COLORS.wordType.incorrectAlpha }}
                    ></div>
                    <h5 className="mb-0">Incorrect</h5>
                  </div>
                  <div className="h3 text-dark">{metrics.incorrect}</div>
                </Card>
              </div>
              <div className="col-6">
                <Card className="p-3">
                  <div className="d-flex align-items-center justify-content-center gap-2 mb-2">
                    <div
                      className="legend-color"
                      style={{ background: COLORS.wordType.missedAlpha }}
                    ></div>
                    <h5 className="mb-0">Missed</h5>
                  </div>
                  <div className="h3 text-dark">{metrics.missed}</div>
                </Card>
              </div>
              <div className="col-6">
                <Card className="p-3">
                  <div className="d-flex align-items-center justify-content-center gap-2 mb-2">
                    <div
                      className="legend-color"
                      style={{ background: COLORS.wordType.extraAlpha }}
                    ></div>
                    <h5 className="mb-0">Extra</h5>
                  </div>
                  <div className="h3 text-dark">{metrics.extra}</div>
                </Card>
              </div>
            </div>
          </Card>
        </div>
      </div>

      <div className="row justify-content-center">
        <div className="col-md-8 col-lg-6">
          <div className="d-flex gap-2">
            <Button
              variant="secondary"
              className="flex-fill"
              icon={<i className="fas fa-home me-2"></i>}
              onClick={handleReturnHome}
            >
              Return Home
            </Button>
            <Button
              className="flex-fill"
              icon={<i className="fas fa-redo me-2"></i>}
              onClick={handleConductAnother}
            >
              Conduct Another Test
            </Button>
          </div>
        </div>
      </div>
    </div>
  );
};

export default ResultPage;
